import React from "react";
import Home from "./components/Home";
import Box from "./components/Three";
import styled from "styled-components";

const BigBox = styled(Box)`
  height: 100vh;
`;

function App() {
  return (
    <div className="App">
      <Home />
      <Box />
    </div>
  );
}

export default App;
